geCode":"und","languageName":{"simpleText":"Unknown Language"}},{"languageCode":"ur","languageName":{"simpleText":"Urdu"}},{"languageCode":"ug","languageName":{"simpleText":"Uyghur"}},{"languageCode":"uz","languageName":{"simpleText":"Uzbek"}},{"languageCode":"vi","languageName":{"simpleText":"Vietnamese"}},{"languageCode":"cy","languageName":{"simpleText":"Welsh"}},{"languageCode":"fy","languageName":{"simpleText":"Western Frisian"}},{"languageCode":"xh","languageName":{"simpleText":"Xhosa"}},{"languageCode":"yi","languageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"86IxCGKUOzY","title":"月詠み『生きるよすが』Music Video","lengthSeconds":"244","keywords":["音楽","アニメ","アニメーションMV","MV","ユリイ・カノン","だれかの心臓になれたなら","誰かの心臓になれたなら"],"channelId":"UC2OgzdgLQ7vxlANVxF3kgvg","isOwnerViewing":false,"shortDescription":"#月詠み 1st Story「#だれかの心臓になれたなら 」\nepisode2 ユマ  1st Song『#生きるよすが 』\n\n各種音楽配信サービスにて配信中。\n⇒https://tsukuyomi.lnk.to/ikiruyosuga\n\nOff Vocal⇒https://piapro.jp/t/MCjU\n\nだれかの心臓になれたなら 廻想録\n⇒https://youtu.be/hdwhxmco6rw\n\n月詠み MVリスト\n⇒https://youtube.com/playlist?list=PLe-ELWE5MyQFHmGizj6EGi3dY5iZj3Hj_\n--------------------------------------------------------\n■recording member\nVocal：Yue （ https://twitter.com/yue_vocal ）\nPiano：ユリイ・カノン（ https://twitter.com/yurryCanon ）\nGuitar：Epoch ( https://twitter.com/AO_tomato8 )　\nBass：とうかさ ( https://twitter.com/toukasa_ )\nDrums：なおk ( https://twitter.com/naodoramu )\n\n■Animation\nmotto（https://twitter.com/28motto ）\n\nInstrumental Technician：白石 経（Sound Base KiTi）\nRecording \u0026 Mixing Engineer：松橋秀幸（birdie house inc.）\nMastering Engineer：山崎翼（Flugel Mastering）\n--------------------------------------------------------\n月詠み Twitter　https://twitter.com/Tsukuyomi_JP\n月詠み official site　https://www.tsukuyomi2943.com/\n小説『だれかの心臓になれたなら』\nhttps://twitter.com/yurryCanon/status/1461322094051233802\n--------------------------------------------------------\n\n\n「生きるよすが」\n作詞作曲：ユリイ・カノン\n編曲：月詠み\n\n夜の藍に咲いて満ちていけ　生きるよすが\n傷も嘘も痛みも詩になれ\n夢を、愛を書いて何を救えますか\n憂う空を染める光になれ\n\nこの世にありふれた幸福の形\nそれじゃ空いた穴は埋められない\n\n嘘つきなんだ僕は　生きているだとか\nこの機械みたいな心でさ\n\n出来ない　解らない　変わらない\n言葉達は無価値な音色と化す\n満たされない　叶わない\nこんな歌じゃ\nああ　だれの心も照らせない\n\n夜の哀を裂いて薙いでいけ　生きるよすが\n間違いも答えも今日も未来も詩になれ\n奏でたこの声が　いま聴こえますか\n愚かな僕の馬鹿げた叫びを\n\nどうか　こんな命に\n明日を生きる理由をくれよ\nどうか　僕を見つけて\n慥かに在る真昼の月を\n\n\n言葉を飲み込んだ喉が疼いた\n胸に痞える　これは何か\n\n心を呑み込んだ闇を仰いだ\n差した茜に　手を伸ばす\n\n全てがそりゃ報われるものじゃない\n時間も金も無駄になるかもな\nいつかは過去に消えていく\nそれでも僕が歌うのはここに生まれたから\n\n正しいだけじゃ救えないものもある\n泣かないことが強さだってんなら\n僕は弱いままでいい\n\n夜の哀を裂いて薙いでいけ　生きるよすが\n間違いも答えも今日も未来も詩になれ\n\nわからない\n才も人生もわかるものか\n嘘だらけでも\nそれでも、\n\n生きろ\n\n愛も何も無くたって明ける夜だ\n生まれた理由なんて後付けだっていい\n\n死にゆく様を　それを美と呼ぶな\n散る為に咲く花なんて無いだろ\n\n醜い程に美しいものを\n欠けた心を埋めてくれよ\n\nどんな歌で　どんな言葉で\n昏い夜のよすがになれる？\n\n神様に願うのは　ただ一つだけ\n\n\n\n--------------------------------------------------------\n■#月詠み\nユリイ・カノンが主催・プロデュースし、物語と音楽を展開するプロジェクト。\n1st Story『だれかの心臓になれたなら』はユリイ・カノンによる同名の楽曲とその関連曲を元に再構築したもの。\n全二章で構成される物語の前章となる、1st mini Album『欠けた心象、世のよすが』を2021年9月にリリース。\n2022年1月『生きるよすが』より後章ユマ編（Vo.Yue）がスタート。\n・月詠み 1st Story『だれかの心臓になれたなら 』episode1 リノ\n　1st mini Album 「欠けた心象、世のよすが」(Vo.mikoto)\n　https://tsukuyomi.lnk.to/kaketa_CD","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/86IxCGKUOzY/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLDyc0gt7Hp-cbzhS5jBNZZmgqX3XA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/86IxCGKUOzY/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLAkkA7sIbFivq7dWm1EP4B_Y-Ev-g","width":196,"height":110},{"url":"https://i.ytimg.com/vi/86IxCGKUOzY/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLCJTl21DjL51N_2yxdk0ciHjqm0QQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/86IxCGKUOzY/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLBVLKuEMEviBG9SPXEDkPR0A1gmcg","width":336,"height":188},{"url":"https:/