simpleText":"#月詠み 1st Story「#だれかの心臓になれたなら 」\nepisode2 ユマ  1st Song『#生きるよすが 』\n\nTsukuyomi　- \"#Reason For Existence \"\nDownload\u0026Streaming\nhttps://tsukuyomi.lnk.to/ikiruyosuga\n------------------------------------------------------------\n#Tsukuyomi\nhttps://twitter.com/Tsukuyomi_JP\n\nwords and music\nYurry Canon　https://twitter.com/yurryCanon \n\nArrangement\nTsukuyomi\n\nrecording member\nVocal：Yue\nPiano：Yurry Canon\nGuitar：Epoch ( https://twitter.com/AO_tomato8 )\nBass：toukasa ( https://twitter.com/toukasa_ )\nDrums：なおk ( https://twitter.com/naodoramu )\n\nAnimation  motto\nhttps://twitter.com/28motto?s=20\n\nInstrumental Technician：白石 経（Sound Base KiTi）\nRecording \u0026 Mixing Engineer：松橋秀幸（birdie house inc.）\nMastering Engineer：山崎翼（Flugel Mastering）\n\n月詠み Twitter\nhttps://twitter.com/Tsukuyomi_JP\n月詠み official site\nhttps://www.tsukuyomi2943.com/\n小説『だれかの心臓になれたなら』\nhttps://twitter.com/yurryCanon/status/1461322094051233802\n------------------------------------------------------------\n\n“reason for existence”\n\nBloom all over in the indigo of the night, the reason to live\nLet your scars, lies, and pain become poetry\nWhat can I save by writing about my dreams and love?\nBe the light that dyes the gloomy sky\n\nA trite form of happiness in this world\nThat's not enough to fill the void\n\nI'm a liar saying I'm alive\nWith this heart like a machine\n\nCan't do, can't understand, can't change\nWords become worthless tones\nCan't be satisfied, can't be fulfilled\nWith a song like this\nOh I can't light up anyone's heart\n\nTear up and slash the sorrow of the night, the reason to live\nLet your mistakes, answers, today and future become poetry\nCan you hear this voice I’m playing now?\nIt’s the foolish cry from stupid me\n\nPlease give this life\nA reason to live tomorrow\nPlease find me\nThe midday moon that is certainly there\n\nMy throat hurts as I swallowed the words\nWhat is this getting stuck in my chest?\n\nI looked up at the darkness that swallowed my heart\nI reach for the glowing red\n\nNot everything will be rewarded\nEven time and money might be wasted\nSomeday everything will fade into the past\nStill I sing because I was born here\n\nJust being right cannot save everything\nIf not crying is the way to be strong\nI'll just stay weak\n\nTear up and slash the sorrow of the night, the reason to live\nLet your mistakes, answers, today and future become poetry\n\nI don't know\nI don't know about our ability or life\nEven if it's full of lies\nBut still\n\nLive \n\nNight ends without love or anything else\nThe reason you were born can be added afterwards\n\nWhen dying, never call it beauty\nThere's no flower that blooms to fall\n\nFill up something uglily beautiful\nAnd my missing heart\n\nWith what songs, what words\nCan I become the reason of the dark night?\n\nI wish for only one thing from God"},"lengthSeconds":"245","ownerProfileUrl":"http://www.youtube.com/channel/UC2OgzdgLQ7vxlANVxF3kgvg","externalChannelId":"UC2OgzdgLQ7vxlANVxF3kgvg","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO"