\nPlease find me\nThe midday moon that is certainly there\n\nMy throat hurts as I swallowed the words\nWhat is this getting stuck in my chest?\n\nI looked up at the darkness that swallowed my heart\nI reach for the glowing red\n\nNot everything will be rewarded\nEven time and money might be wasted\nSomeday everything will fade into the past\nStill I sing because I was born here\n\nJust being right cannot save everything\nIf not crying is the way to be strong\nI'll just stay weak\n\nTear up and slash the sorrow of the night, the reason to live\nLet your mistakes, answers, today and future become poetry\n\nI don't know\nI don't know about our ability or life\nEven if it's full of lies\nBut still\n\nLive \n\nNight ends without love or anything else\nThe reason you were born can be added afterwards\n\nWhen dying, never call it beauty\nThere's no flower that blooms to fall\n\nFill up something uglily beautiful\nAnd my missing heart\n\nWith what songs, what words\nCan I become the reason of the dark night?\n\nI wish for only one thing from God"}]},"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"}}},{"videoDescriptionMusicSectionRenderer":{"sectionTitle":{"simpleText":"Music"},"carouselLockups":[{"carouselLockupRenderer":{"infoRows":[{"infoRowRenderer":{"title":{"simpleText":"SONG"},"defaultMetadata":{"simpleText":"生きるよすが"},"trackingParams":"CCQQyMoHGAUiEwilq73c6vH8AhWhQfUFHdiNAoA="}},{"infoRowRenderer":{"title":{"simpleText":"ARTIST"},"defaultMetadata":{"runs":[{"text":"Tsukuyomi","navigationEndpoint":{"clickTrackingParams":"CCMQy8oHGAYiEwilq73c6vH8AhWhQfUFHdiNAoA=","commandMetadata":{"webCommandMetadata":{"url":"/channel/UC2OgzdgLQ7vxlANVxF3kgvg","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UC2OgzdgLQ7vxlANVxF3kgvg","canonicalBaseUrl":"/channel/UC2OgzdgLQ7vxlANVxF3kgvg"}}}]},"trackingParams":"CCMQy8oHGAYiEwilq73c6vH8AhWhQfUFHdiNAoA=","infoRowExpandStatusKey":"structure